import React from 'react';
import Flashcard from '../../Components/Flashcard/Flashcard';
import CardList from '../../Components/CardList/CardList';
import flashcardData from './cardData.json';

const NodeQuestions = () => {
  var data = JSON.parse(JSON.stringify(flashcardData));
  return (
    <div>
      <div className="overlay-container">
        <h1>Flashcards Topic: Node.js</h1>
        <h2>Question Set Contains {data.flashcards.length} Flashcards</h2>
        <div>Source(s): </div>
        <div>https://www.interviewbit.com/node-js-interview-questions/</div>
        <div>https://www.geeksforgeeks.org/node-interview-questions-and-answers/</div>
      </div>
      <CardList flashcards={data.flashcards} />
    </div>
  );
}

export default NodeQuestions;
